import { Link } from 'react-router-dom';
import './Header.css'

function Header() {
    return (
        <div className="header">
            <div className="header_left">
                <Link to="/"> LOGO </Link>
            </div>

            <div className="header_right">
                
            </div>
        </div>
    )
}

export default Header
